import React, { Component } from 'react';

class Navbar extends  Component{

   render(){   
       const { friends } = this.state;
       const mates = friends.map(friend=>{
        return(
           <div>
               <ul>
                   <li>friend.name</li>
                   <li>friend.interest</li>
                   <li>friend.age</li>
               </ul>
           </div>
        )          
       })
    return(
        <div>
        {mates}
        </div>
    )      
   }
}

export default Navbar
